INSERT INTO `text_response` VALUES (1,'？','您好，欢迎光临柑普堂！请回复数字提问：1：柑普茶如何冲泡？2：柑普茶和桔普茶有什么分别？3：柑普茶如何存放？',1),(2,'1','每个分3-4次品尝（小青柑一次一个），掰开果壳取6片指甲大小的果皮，一汤匙(8克)左右茶叶，用沸水浸泡5-10秒，前两趟水洗茶热身，之后每趟酌量延长浸泡时间。本方法以100ml容器为例，分量和浸泡时间请根据容量自行调整。',1),(3,'2','柑是新会当地知名特产，新会柑全球闻名，其果皮厚，营养物质丰富，果皮内部有特殊的油胞，果油丰富，气味高香强烈，具备很好的养成和收藏价值，但价格稍高。桔则是替代品，价格低些，果油含量相对少一点，香气低沉，和柑的气味风格有别。',1),(4,'3','最好用玻璃容器密封保存，放置于阴凉干燥无阳光折射的环境下。如无玻璃容器，可以选择金属容器，密封拉链袋。切勿放冰箱，常温干燥就可以了。环境合适可以长时间（100年以内）陈化保存，越老越香。',1);
